import React from 'react';

function Dislike_page({ dislikedBlogs }) {
  return (
    <div>
      <div className="news-header">
        <img src="/img/logo.jpeg" alt="Logo" />
        <h1>Черный список блогов</h1>
      </div>
      <div className="content">
        {dislikedBlogs && dislikedBlogs.map((blog, index) => (
          // ваш код для отображения каждого блога в черном списке
          <div key={index}>{blog.name}</div>
        ))}
      </div>
    </div>
  );
}

export default Dislike_page;
